import './App.css';
import three from './components/three';
import merge from './components/merge';

function App() {
  return (
    <div className="App flex flex-row">
      <div className="w-1/2 p-4">
        <merge />
      </div>
      <div className="w-1/2 p-4">
        <three />
      </div>
    </div>
  );
}

export default App;
